game_start:
	la $a0, game_start_scene
	li $a1, 0
	li $a2, 0
	jal render_item		# render start menu
	
	li $s3, 0		# if start, s0 = 0. If exit, s0 = 1
game_start_loop:
	# Sleep MS
	li $v0, 32
	li $a0, MS
	syscall
game_start_input:
	# detect input
	li $s0, KEYPRESS_ADDR
	lw $s1, 0($s0)
	beq $s1, 0, game_start_loop
game_start_pressed:
	# get input
	lw $s1, 4($s0)
	# handle input
	beq $s1, KBD_P, game_start_pressed_p
	beq $s1, KBD_W, game_start_pressed_ws
	beq $s1, KBD_S, game_start_pressed_ws
	beq $s1, KBD_SPACE, game_start_pressed_space
	j game_start_loop
game_start_pressed_p:
	j game_start
game_start_pressed_ws:
	xori $s3, $s3, 1
	beqz $s3, game_start
	la $a0, game_start_exit_scene
	li $a1, 0
	li $a2, 0
	jal render_item
	j game_start_loop
game_start_pressed_space:
	beqz $s3, main
	j game_exit


main:

# Clear Screen __________________________________________________________

ClearScreen:
	# clear the whole screen
	li $a0, 0
	li $a1, 0
	li $a2, 64
	li $a3, 128
	jal clear_box
Set_player:
	li $s0, P_ROW
	sw $s0, p_r
