# main_loop keyboard input handler __________________________	
input:
	li $s7, KEYPRESS_ADDR
	lw $s6, 0($s7)
	beq $s6, 0, no_keypress
pressed:
	lw $s6, 4($s7)
	bne $s6, KBD_P, not_p
pressed_p:
	j game_start
not_p:	bne $s6, KBD_A, not_a
pressed_a:
	lw $s0, p_c
	# if s0 = 0, branch to not_a
	beqz $s0, not_a
	beq $s0, 1, a_move_else
	addi $s0, $s0, -2
	j a_move_end
a_move_else:
	addi $s0, $s0, -1
a_move_end:	
	sw $s0, p_c

not_a:	bne $s6, KBD_D, not_d
pressed_d:
	lw $s0, p_c
	# if s0 = 127, branch to not_d
	li $s1, 128
	subi $s1, $s1, P_C
	beq $s0, $s1, not_d
	subi $s1, $s1, 1
	beq $s0, $s1, d_move_else
	addi $s0, $s0, 2
	j d_move_end
d_move_else:
	addi $s0, $s0, 1
d_move_end:
	sw $s0, p_c

not_d:	beq $s6, KBD_W, pressed_w
not_w:	bne $s6, KBD_SPACE, not_w_space	
pressed_w:
	lw $s3, p_land	# s3 = jump state
	beq $s3, 2, not_w_space
	beq $s3, 1, pressed_w_1
	beq $s3, 0, pressed_w_2
	j not_w_space
pressed_w_1:
	# first jump handle
	li $s3, JUMP
	sw $s3, p_j
	li $s0, 0	# p_land = 1 => player in first jump state
	sw $s0, p_land
	j not_w_space
pressed_w_2:
	# second jump handle
	li $s3, JUMP
	sw $s3, p_j
	li $s0, 2	# p_land = 2 => player in second jump state
	sw $s0, p_land
not_w_space:

no_keypress:
# process land ________________________________________________
# run landed to find whether palyer lands
	jal landed
	add $s0, $v0, $zero # s0 = state that player is landed
	
# process jump ________________________________________________
# update p_r according to p_j, p_land, s0 (landed state)
	lw $s1, p_j
	lw $s2, p_land
	
	beq $s2, 1, jump_onfloor
jump_inair:
	beqz $s1, jump_down
jump_up:	# move up
	# p_j -= 1
	addi $s1, $s1, SPD_LOSS		# s1 --	
	sw $s1, p_j
	# update new p_r, p_j -= 1
	lw $s4, p_r
	addi $s4, $s4, -1
	sw $s4, p_r
	j jump_inair_end
jump_down:	# move down
	beqz $s0, jump_down_not_landed	# branch to jump_down_not_landed if not landed
jump_down_landed:
	# now landed, so p_r keeps, p_land -> 1, p_j -> 0
	li $s2, 1
	sw $s2, p_land
	li $s1, 0
	sw $s1, p_j
	j jump_inair_end
jump_down_not_landed:
	# calculate new p_r, p_land and p_j keeps
	lw $s4, p_r
	addi $s4, $s4, 1
	sw $s4, p_r
	
jump_inair_end:
	j jump_end
jump_onfloor:
	# check s0(landed), if not on floor branch 	
	beq $s0, 1, jump_onfloor_end
jump_onfloor_fall:
	# player falls
	li $s1, 0
	sw $s1, p_j
	li $s2, 0
	sw $s2, p_land
	j jump_onfloor_end	
jump_onfloor_end:
jump_end:

