# landed __________________________
landed:
	lw $t1, p_r
	lw $t2, p_c
	li $v0, 0
	# t9 = p_j
	lw $t9, p_j
	bgtz $t9, landed_end 	# if player is jumping up, return 0(false)
	# else continue
	# set t3 = sll((r+5), SLL_W) + c (left foot pos)
	addi $t3, $t1, 5
	sll $t3, $t3, SLL_W
	add $t3, $t3, $t2
	# t0 = addr of left foot
	sll $t0, $t3, 2
	addi $t0, $t0, BASE_ADDR
	lw $t4, 0($t0)
	li $t5, PF_COLOR
	bne $t4, $t5, landed_next
	li $v0, 1
landed_next:
	addi $t3, $t3, 4
	sll $t0, $t3, 2
	addi $t0, $t0, BASE_ADDR
	lw $t4, 0($t0)	# color of right foot
	bne $t4, $t5, landed_end
	li $v0, 1
landed_end:
	
	jr $ra	
	
	
# collision ________________________
# return v0 = 1 if collapse, v0 = 0 otherwise
	# a0 = bottom(R')/ object's row_start
	# a1 = left(R')/ object's col_start
	# a2 = object's row_size
	# a3 = object's col_size
	# saved register used: none
	
collision:
	# set a2 = top(R') 
	add $a2, $a2, $a0
	# set a3 = right(R')	
	add $a3, $a3, $a1
	
	lw $t0, p_r		# set t0 = bottom(R)
	lw $t1, p_c		# set t1 = left(R)
	addi $t2, $t0, P_R	# set t2 = top(R)
	addi $t3, $t1, P_C	# set t3 = right(R)
	

	bgt $t1, $a3, collision_else
	bgt $a1, $t3, collision_else
	bgt $t0, $a2, collision_else
	bgt $a0, $t2, collision_else
	li $v0, 1	# There is a collision
	j collision_end
collision_else:
	li $v0, 0	# no collision
collision_end:
	jr $ra	
	
	
# clear_box _________________________
	# a0 = row_start
	# a1 = col_start
	# a2 = row_size
	# a3 = col_size
	# saved register used: none
clear_box:
	# t8 = row, t9 = col, set t8 to 0
	li $t8, 0
	li $t7, BACKGROUND_COLOR	# t7 = BACKGROUND_COLOR
	# if t8 >= row_size, branch to clear1_end
clear1:	bge $t8, $a2, clear1_end
	# t0 = BASE_ADDR + ((a1 + t8)*SLL_W+a0)*4
	add $t0, $a0, $t8
	sll $t0, $t0, SLL_W
	add $t0, $t0, $a1
	sll $t0, $t0, 2
	addi $t0, $t0, BASE_ADDR
	li $t9, 0
	# if t9 >= col_size, branch to clear2_end
clear2:	bge $t9, $a3, clear2_end
	# clear pixel
	sw $t7, 0($t0)
	
	# update col, t0
	addi $t9, $t9, 1
	addi $t0, $t0, 4
	j clear2
clear2_end:
	# update row
	addi $t8, $t8, 1
	j clear1
clear1_end:
	# return
	jr $ra	

# render_platform _______________
	# a0 = row_start of platform
	# a1 = col_start of platform
	# a2 = length of the platform
render_platform:
	
	# t0 = BASE_ADDR + ((a0)*SLL_W+a1)*4
	add $t0, $a0, $zero
	sll $t0, $t0, SLL_W
	add $t0, $t0, $a1
	sll $t0, $t0, 2
	addi $t0, $t0, BASE_ADDR
	# t1 = platform color
	li $t1, 0x188222
	#t9 = col, set t9 to 0
	li $t9, 0
render_platform_loop:
	bge $t9, $a2, render_platform_end
	
	sw $t1, 0($t0)
render_platform_update:
	addi $t9, $t9, 1
	addi $t0, $t0, 4
	j render_platform_loop
render_platform_end:
	jr $ra	
	
# render_item ___________________
	# a0 = address of the item
	# a1 = row_start
	# a2 = col_start
	# saved register used: none
render_item:
	# t8 = row, t9 = col, set t8 to 0
	li $t8, 0		
	 
	lw $t1, 0($a0)		# t1 = row_size,
	lw $t2, 4($a0)		# t2 = col_size
	addi $t3, $a0, 8	# t3 = item address
	# if row >= row_size branch to render1_end
render1:
	bge $t8, $t1, render1_end
	# t0 = BASE_ADDR + ((a1 + t8)*SLL_W+a2)*4
	add $t0, $a1, $t8
	sll $t0, $t0, SLL_W
	add $t0, $t0, $a2
	sll $t0, $t0, 2
	addi $t0, $t0, BASE_ADDR
	li $t9, 0	# set t9 to 0
	# if col >= col_size branch to render2_end
render2:
	bge $t9, $t2, render2_end
	add $t6, $a1, $t8		# if row is out of screen, update
	bltz $t6, render2_update
	bge $t6, HEIGHT, render2_update
	add $t6, $t9, $a2		# if col is out of screen, update
	bltz $t6, render2_update	
	bge $t6, WIDTH, render2_update	
	lw $t6, 0($t3) 			# render pixel
	sw $t6, 0($t0)
	# update row, pixel_addr, pixel_read_addr
render2_update:
	addi $t9, $t9, 1
	addi $t0, $t0, 4
	addi $t3, $t3, 4
	j render2
render2_end:
	# update col
	addi $t8, $t8, 1
	j render1
render1_end:
	jr $ra

# copy_array
	# a0: addr of source arr
	# a1: addr of target arr
	# a2: length
copy_array:
	add $t0, $a0, $zero
	add $t1, $a1, $zero
	li $t2, 0
copy_array_loop:
	beq $t2, $a2, copy_array_end
	lw $t3, 0($t0)
	sw $t3, 0($t1)
copy_array_update:
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t2, $t2, 1
	j copy_array_loop
copy_array_end:
	jr $ra	
	
